INSERT INTO `layouts` (`id`, `html`, `type`) VALUES
(61, '<style type="text/css"> \r\n\r\n   li.product\r\n   {\r\n       position:relative;\r\n       float:left;\r\n       width:225px;\r\n       height:225px;\r\n       margin-right:1px;\r\n       margin-left:5px;\r\n   }\r\n   * html li.product\r\n   {\r\n       background-image:none;\r\n       filter:progid:DXImagetransform.Microsoft.AlphaImageLoader(src="http://vubla.com/bgsearch.png",sizingMethod="scale");\r\n   }\r\n   li .product_price\r\n   {\r\n       /*\r\n       Herunder kan du indstille fonten på din pris\r\n       */\r\n       font-family:"Lucida Grande",Verdana,Arial,sans-serif;\r\n       \r\n       /*\r\n       Herunder kan du indstille skriftstørrelsen på din pris\r\n       */\r\n       font-size:14px;  \r\n       \r\n       /*\r\n       Herunder kan du indstille farven på teksten af din pris\r\n       */\r\n       color: #030303 !important;\r\n       \r\n       /*\r\n       Herunder kan du instille baggrundsfarven,\r\n       samt baggrundsbilledet som din pris skal have.\r\n       */\r\n       background-color:#FFF;\r\n       background:#f1f1f1 url("http://vubla.com/searchf.png") repeat-x left top;\r\n       \r\n       z-index:1000;\r\n       position:absolute;\r\n       top:13px;\r\n       right:13px;\r\n       padding:0 0 3px 6px;\r\n       -moz-border-radius-bottomleft:5px;\r\n       -webkit-border-bottom-left-radius:5px;\r\n   }\r\n   li a:hover .product_price\r\n   {\r\n       /*\r\n       Herunder kan du instille baggrundsfarven, som din\r\n       pris får, når du holder musen over produktet.\r\n       */\r\n       background:#e8dd35;\r\n   }\r\n   li .product_name\r\n   {\r\n\r\n       /*\r\n       Herunder kan du indstille farven for produktnavn-teksen.\r\n       */\r\n       color:#333 !important;\r\n\r\n       /*\r\n       Herunder kan du indstille baggrundsfarve og baggrundsbillede for produktnavnet\r\n       */\r\n       background-color: #FFF;  \r\n       background: url("http://vubla.com/searchf.png") repeat-x left bottom;\r\n       \r\n       /*\r\n       Herunder kan du indstille skriftstørrelse og font for produktnavn.\r\n       */\r\n       font-size:13px;\r\n       font-family: Helvetica;\r\n\r\n       z-index:1001;\r\n       position:absolute;\r\n       bottom:13px;\r\n       left:13px;\r\n       max-width:187px;\r\n       margin:0;\r\n       padding:4px 8px;\r\n       -moz-border-radius-topright:5px;\r\n       -webkit-border-top-right-radius:5px;\r\n   }\r\n   li a:hover .product_name\r\n   {\r\n       /*\r\n       Herunder kan du indstille baggrundsfarven for produktnavn,\r\n       som den får når man holder musen over produktet.\r\n       */\r\n       background:#e8dd35;\r\n   }\r\n   li.product a\r\n   {\r\n       display:block;\r\n       margin:8px 0 0 8px;\r\n   }\r\n   li.product a img\r\n   {\r\n       /*\r\n       Herunder kan du redigere den øverste baggrundsfarve og baggrundsbilledet,\r\n       for produktet.\r\n       */\r\n       background:#f1f1f1 url("http://vubla.com/searchf.png") repeat-x left bottom;\r\n\r\n       position:absolute;\r\n       width:199px;\r\n       height:199px;\r\n       padding:5px;\r\n       -moz-border-radius:3px;\r\n       -webkit-border-radius:3px;\r\n   }\r\n   li.product a:hover img\r\n   {\r\n       /*\r\n       Herunder kan du indstille baggrundsfarven, som produktet får, når du holder musen over.\r\n       */\r\n       background:#e8dd35;\r\n   }\r\n   ul\r\n   {\r\n       list-style-type: none;\r\n   }\r\n   </style>\r\n\r\n\r\n<ul>\r\n\r\n[@produktliste_start]\r\n <li class="product" id="products_[@produkt_navn]"> \r\n   <a href="[@produkt_link]"> \r\n     <img src="[@billede_sti]"><span class="product_price">[@pris]</span> \r\n     <span class="product_name">[@produkt_navn]</span> \r\n   </a> \r\n </li> \r\n[@produktliste_slut]\r\n\r\n</ul>', 0),
(62, 'Din søgning på "[@keywords]" gav ikke noget resultat.', 1),
(63, '<style type="text/css"> \r\n#vbl-search-results-header {\r\nmargin-bottom: 30px;\r\n\r\npadding: 5px;\r\n\r\nbackground: #e7e8e7;\r\n\r\nborder-top: 1px solid #d0d1d1;\r\nborder-bottom: 1px solid #d0d1d1;\r\n}\r\n\r\n#vbl-product-list {\r\nmargin: 0;\r\n\r\npadding: 0;\r\n\r\nlist-style: none;\r\n}\r\n\r\n#vbl-product-list li {\r\nmin-height: 20px;\r\n\r\npadding: 10px 10px 10px 5px;\r\n\r\noverflow: auto;\r\n\r\nborder-bottom: 1px solid #d0d1d1;\r\n\r\nclear: both;\r\n}\r\n\r\n#vbl-product-list li img {\r\nmargin-right: 10px;\r\nfloat: left;\r\n}\r\n\r\n.vbl-product-name {\r\nfont-size: 15px;\r\nfont-weight: bold;\r\n}\r\n\r\n.vbl-product-price {\r\nfont-size: 12px;\r\n}\r\n\r\n.vbl-product-discounted:before, .vbl-product-price:before, .vbl-product-discount:before {\r\ncontent: "$";\r\n}\r\n\r\n.vbl-product-discounted {\r\ntext-decoration: line-through;\r\nfont-size: 10px;\r\n}\r\n\r\n.vbl-product-discount {\r\nfont-weight: bold;\r\nfont-size: 12px;\r\ncolor: red;\r\n}\r\n\r\n.vbl-buy-now-link {\r\ndisplay: inline-block;\r\n\r\nfloat: right;\r\n\r\npadding: 10px;\r\n\r\nbackground: #e10000;\r\n\r\nborder: 1px solid #ab0000;\r\n}\r\n\r\n.vbl-buy-now-link:link {text-decoration: none; font-weight: bold; color: #ffffff;}\r\n.vbl-buy-now-link:visited {text-decoration: none; font-weight: bold; color: #ffffff;}\r\n.vbl-buy-now-link:hover {text-decoration: none; font-weight: bold; color: #ffffff; background: #ee1313;}\r\n.vbl-buy-now-link:active {text-decoration: none; font-weight: bold; color: #ffffff; background: #ee1313;}\r\n</style>\r\n\r\n<div id="vbl-search-results-header">\r\nVi hittade <b>[@produkter_total]</b> produkter för <b>[@keywords]</b>\r\n</div>\r\n\r\n<ul id="vbl-product-list">\r\n[@produktliste_start]\r\n<li>\r\n\r\n<a class="vbl-buy-now-link" href="[@køb_nu_link]">Køb nu</a>\r\n<img src="[@billede_sti]" alt="[@produkt_navn]" />\r\n<a class="vbl-product-name" href="[@produkt_link]">[@produkt_navn]</a><br />\r\n[@pris_discount]\r\n\r\n</li>\r\n[@produktliste_slut]\r\n</ul>', 0),
(64, 'Din søgning på "[@keywords]" gav ikke noget resultat.', 1),
