(4803, 'H4 Philips X-treme Vision +100%  Twin Pack', 407, 7, '', ''),
(4804, 'X-tremeVision forlygter giver op til 100% mere lys på vejen og er blandt de kraftigste godkendte halogenpærer på markedet . X-tremeVision er udviklet til bilister, der ønsker forlygter med en speciel udstråling og maksimal ydeevne . Med Philips X-tremeVision opgraderer du dine forlygter til optimal ydeevne og giver bilen et iøjnefaldende look.Lyset er kraftfuld og intens og mængden af lys fra X-tremeVision gør dem ideelle til bilister, hvor sikkerheden for passagererne er i højsæde. X-tremeVision giver højeste ydeevne Fås i H1,H4 og H7 Giver et hvidt, klart lys 12V, 55W Godkendt til brug i hele Europa AnmeldelseVed undersøgelse af X-tremeVision ved siden af både standard og højtydende pærer, satte den de andre bogstaveligtalt i skyggen. En massiv forskel som tydeligt kunne ses på lystunnellens væg. Philips har præsteret at få det maksimale ud af pæren, og det må konstateres at være en strålende forbedring af trafiksikkerheden.Bemærk: Pærerne sælges i en boks af 2 stk.Everlight anbefalerHvis du leder efter den absolut bedste opgradering af dine forlygter er det dette produkt du skal vælge. ', 407, 8, '', ''),
