(4814, 'H1 Osram Night Breaker +90%  Twin Pack', 408, 7, '', ''),
(4815, 'Den ideelle pæretil dig, der prioriterer sikkerheden højest. Osram Night Breaker giver op til 90% mere lys på vejen for optimal synlighed og sikkerhed, og et 10% hvidere lys for minimal blænding og optimal komfort.Op til 90% mere lys på vejen Forlænger lyskeglen med op til 35 meter 10% hvidere lys Godkendt til brug i hele Europa Med NIGHTBREAKERfår du maksimal sikkerhed og bedre overblik. Osram bryder tidligere rekorder hvad angår ydeevne og gør Night Breaker attraktiv for den sikkerhedsbevidste bilist.Det hvide lys fra NIGHTBREAKER virker mindre anstrengende for øjnene og giver en mere behagelig kørsel.Hele NIGHT BREAKER programmet er godkendt til kørsel i hele Europa.Med NIGHT BREA­KER bliver du mør­kets mester!Bemærk: Pærerne sælges i en boks med 2 stk.Everlight anbefalerVi anbefaler Night Breaker til dig, der ønsker mest muligt lys på vejen uden at skifte til xenon lys, men også til dig som vil have et hvidere og mere behageligt kørelys. ', 408, 8, '', ''),
