(8167, 'Blue Vision gør nat til dag og giver din bil et køligt look. Xenon lignende lys i 4000K Et unikt blåt filter skaber det karakteristiske blå lys Konstrueret i quartz glas som sikrer ultimativ ydelse 12V, 55W Godkendt til brug i hele Europa Det mest optimale for en bilist vil være dagslys 24 timer i døgnet, fordi sigtbarheden er bedst i dagslys. Derfor har Philips udviklet Blue Vision med en blå belægning, som udsender et lys der minder om dagslys ligesom xenon.Bemærk: Pærerne sælges i en boks med 2 stk.Everlight anbefalerBlue Vision giver et flot hvidt lys med en blå nuance, og efter at have testet pærerne må vi konstatere, at det er et fremragende kørelys som gør opgaven at køre om natten til en oplevelse!', 707, 8, '', ''),
