(9937, 'Xenon arbejdslygten EL-HID335 er et CE godkendt kvalitetsprodukt fra \nEverlight. Lygten benytter xenon teknologi, hvilket betyder, at lygten \ngiver 3 gange så stor lysstyrke som 55W halogenlys, og xenon lys oplyser\n derfor arbejdsområdet længere og bredere. Xenon lys giver \ndagslyslignende belysning af arbejdsområdet og en naturlig \nfarvegengivelse, også om natten.Xenon arbejdslygten fra \nEverlight har integreret ballast/startelektronik i det kompakte \nlygtehus, og kan derfor monteres direkte i stedet for halogenlygten.Xenon\n lys har den store fordel, at det stadig kun bruger 55W, men samtidig \ngiver super meget mere lys. Xenon pæren har op til 5 gange længere \nlevetid i forhold til halogenpærer, hvilket resulterer i lavere \nomkostninger.... dette er fremtidens lys fra Everlight!Everlight XENON arbejdslygte - EL-HID335 - 6000K har et kraftigt lys med hvid farve, dagslyslignende belysning.Se 3d foto af EL-HID335 her!', 866, 8, '', ''),
