(9957, 'Denne LED indbygningsspot indeholder7 x 1 Watt High Power LEDdioder. Farven er 3000K, et behageligt varmt lys.Den giver det samme lys som en tilsvarende Halogen spot på 70 Watt.LED Spotlampen tilsluttes direkte 220V. LED Lampen kan dæmpes med en elektronisk Lysdæmper. Dette giver mulighed for at have kraftigt lys når det er nødvendigt.Samtidig har manmulighed for at bruge det til hygge belysning ved at dæmpe det.Et rigtig godt produkt til at spare på energien.Co2 venlig lyskilde.Spar på forbruget.Lyser konstant 50.000+ timer.Høj lumenværdi. Undgå flimrende lys.Mindre varmeafgivelse.Kan dæmpes. CE godkendt.Ingen UV eller IR stråling.3 års garanti.LED, Fremtidens Lys !', 868, 8, '', ''),
