(10504, 'BakKamera med Night Visiontil montering på nummerpladen. Dette Vandtætte Kamera ernemt atinstallere på din nummerplade.Det giver dig enkrystalklar og vidvinkelvisning af alt bag dig. Beskyt dig selv og dine passagerer fra uønskede ulykker med dette smartekamera.Dette bakkamera passer din nummerpladeog giver alt hvad du behøver forat gøredin parkering sikker og nem. Kameraeter hurtig atinstallere ogmonterepå din nuværende nummerplade.Bakkameraet er helt vandtæt(IP68), du kan bruge det i alle typer af vejr forhold.Dettevandtætte bakkamera bruger en RCA forbindelse, den forbindes til din bil DVD-afspiller (GPS Navigator, LCD skærm, osv.)det giveren 170 graders vidvinkel visning og 628x582 opløsningvisning af alt bag dig.Bakkameraet tilsluttes baklyset på bilen og tænder automatisknår bilen er i bakgear,skærmen vil også tændeautomatisk.Når du ser din skærm,vil en måling grafiskhjælpe digmed at vurdere afstand.Dettebakkamera er Vandtæt, kompakt og let somgør det selv installation.Bakkameraet der gør parkering og bakning meget sikrere.Fordele ... Bakke og parkering på den nemme måde. 170 graders vidvinkel. Nem installation. Passer tilalle biler. Vandtæt(IP68).Specifikationer.Image sensor 1/4" Color CMOSVandtæt IP 68TV System PALMinimumlysstyrke 0,5 LUXPixels 628x582Opløsning 420 TVLWide Angle 170 GraderForbindelse RCAStrøm forsyning DC12VDimensioner. Længde 250 mm x Bredde 30 mm x Dybde 25 mmMedfølgende AV kabel 5,5m ', 920, 8, '', ''),
